import React from "react";
import HomeInteriorSlider from "./HomeInteriorSlider";
import MeetingRoomIcon from "@material-ui/icons/MeetingRoom";
import DirectionsCarIcon from "@material-ui/icons/DirectionsCar";
import CheckIcon from "@material-ui/icons/Check";
import EventNoteIcon from "@material-ui/icons/EventNote";
import AccessibleForwardOutlinedIcon from "@material-ui/icons/AccessibleForwardOutlined";
import PropertyViewAgent from "./PropertyViewAgent";
import VPForm from "./VPForm";
import CardSingle from "./CardSingle";
import house1 from "./img/house1.jpg";
import house2 from "./img/house2.jpg";
import house3 from "./img/house3.jpg";
import house4 from "./img/house4.jpg";
import house5 from "./img/house5.jpg";
import house6 from "./img/house6.jpg";
import house7 from "./img/house7.jpg";
import house8 from "./img/house8.jpg";
import house9 from "./img/house9.jpg";
import house10 from "./img/house10.jpg";
import house11 from "./img/house11.jpg";
import house12 from "./img/house12.jpg";
import house13 from "./img/house13.jpg";
import house14 from "./img/house14.jpg";
import house15 from "./img/house15.jpg";
import house16 from "./img/house16.jpg";
import SidebarCards from "./SidebarCards";
import LandingPageSingleCard from "./LandingPageSingleCard";
import TestCarousel from "./TestCarousel";
import FeaturedListings from "./FeaturedListings";
import Footer from "./Footer";
import MortgageCalculator from "@herilsaha/mortgage-calculator";
import "./Calculator.css";
import PagesHero from "./PagesHero";
import "./AllProperties.css";
import AllAgentsSidebar from "./AllAgentsSidebar";
import agent1 from "./img/agent1.jpg";
import agent3 from "./img/agent3.jpg";
import agent4 from "./img/agent4.jpg";
import ArrowBackIosIcon from "@material-ui/icons/ArrowBackIos";
import ArrowForwardIosIcon from "@material-ui/icons/ArrowForwardIos";
import propertybg from "./img/propertybg.jpg";
import apt1 from "./img/apartment1.jpg";
import apt2 from "./img/apartment2.jpg";
import apt3 from "./img/apartment3.jpg";
import SortByContent from "./SortByContent";

function AllPropertiesMansionInFoxchapel(props) {
  return (
    <div>
      <div className="dark_gradient"></div>
      <PagesHero  headerTitle="All Listings" parallaximg1={propertybg} />
      <SortByContent />
      <div className="all_properties">
        <div className="all_properties_flex">
          <div className="ap_left">
          <CardSingle
              cardImg={house3}
              agentImg={agent1}
              cardTitle="Mansion on Lorem Ave"
              address="555 Lorem Avenue, Lorem, PA 12345, USA"
              cardPrice="$2,300,000"
              bedrooms="4"
              bathrooms="5"
              sqft="5000 SqFt"
              cardimgalt="mansion"
              filteritem="house agent1"
              featured="Featured"
              forsale="For Sale"

            />
            <CardSingle
              cardImg={house4}
              agentImg={agent1}
              cardTitle="Mansion on Lorem Ave"
              address="555 Lorem Avenue, Lorem, PA 12345, USA"
              cardPrice="$900,000"
              bedrooms="2"
              bathrooms="3"
              sqft="2750 SqFt"
              cardimgalt="house"
              filteritem="house agent1"
              featured="Featured"
              forsale="For Sale"

            />
            <CardSingle
              cardImg={house2}
              agentImg={agent1}
              cardTitle="Mansion on Lorem Ave"
              address="555 Lorem Avenue, Lorem, FL 12345, USA"
              cardPrice="$1,800,000"
              bedrooms="3"
              bathrooms="4"
              sqft="4500 SqFt"
              cardimgalt="mansion"
              featured="Featured"
              forsale="For Sale"
              filteritem="house agent1"
            />
            
            <CardSingle
              cardImg={house16}
              agentImg={agent3}
              cardTitle="Villa on Lorem Street"
              address="555 Lorem Avenue, Lorem, PA 12345, USA"
              cardPrice="$4,300,000"
              bedrooms="3"
              bathrooms="4"
              sqft="5,200 SqFt"
              cardimgalt="mansion"
              filteritem="house agent3"
              featured="Featured"
              forsale="For Sale"


            />
            <CardSingle
              cardImg={house9}
              agentImg={agent4}
              cardTitle="Villa on Lorem Street"
              address="555 Lorem Avenue, Lorem, FL 12345, USA"
              cardPrice="$680,000"
              bedrooms="2"
              bathrooms="4"
              sqft="3,200 SqFt"
              cardimgalt="house"
              plink="/HouseInEdgeworth"
              featured="Featured"
              forsale="For Sale"
              filteritem="house agent4"

            />
            <CardSingle
              cardImg={house12}
              agentImg={agent4}
              cardTitle="Villa on Lorem Street"
              address="555 Lorem Avenue, Lorem, PA 12345, USA"
              cardPrice="$499,999"
              bedrooms="2"
              bathrooms="3"
              sqft="2,850 SqFt"
              cardimgalt="house"
              filteritem="house agent4"
              featured="Featured"
              forsale="For Sale"


            />
            <div className="ap_pagination">
              <a href="/AllProperties" className="ap_arrow_back">
                <ArrowBackIosIcon />
              </a>
              <a href="/AllProperties" className="ap_1 ap_1_p1">
                1
              </a>
              <a href="/AllPropertiesMansionInFoxchapel" className="ap_2 ap_2_p2">
                2
              </a>
              <a href="/AllPropertiesMansionInFoxchapel" className="ap_arrow_forward">
                <ArrowForwardIosIcon />
              </a>
            </div>
          </div>
          <div className="ap_sidebar">
            <div className="ap_sidebar_item">
              <h3>Our Agents</h3>
              <AllAgentsSidebar
                agentSBImg={agent1}
                agentSBName="John Ryan"
                agentSBPhone="(123)-456-1235"
              />
            </div>
            <div className="ap_sidebar_item">
                <h3>Featured Listings</h3>
              <FeaturedListings />
            </div>
            <div className="ap_sidebar_item">
                <h3>Mortgage Calculator</h3>
              <MortgageCalculator />
            </div>
          </div>
        </div>
      </div>
      <Footer />
    </div>
  );
}

export default AllPropertiesMansionInFoxchapel;
